import React, { useState } from "react";
import '../styling/Navigationbar.css';
import { Dropdown, DropdownType } from 'react-bootstrap';
import {
  Link
} from "react-router-dom";
import Cookies from 'js-cookie'
function SavedQuestions() {

  const [questioncookies, setQuestioncookies] = useState(Cookies.get)
  const getCookies = () => {
    setQuestioncookies(Cookies.get())
  }

  return (
       <DropdownType
       onClick={getCookies}
        size="sm"
        variant="secondary"
        title="Drop small"
      >
      <Dropdown.Menu>
      <Link to={"/" + questioncookies.QuestionID}>
          <Dropdown.Item href="#/action-1">Your Question</Dropdown.Item>
        </Link>
      </Dropdown.Menu>
    </DropdownType>
  )
}
export default SavedQuestions
